import React from 'react';
import Link from 'next/link';
import { Row, Col, Divider,Typography,Carousel,Timeline } from 'antd';

const { Title } = Typography;

const IndexPage = ({props}) => {
    return (
        <div>
            여기에는 회사의 소개 페이지가 들어갈 예정입니다.
            회사 소개와 회사 위치만 들어갈 예정입니다.
            <div>1987 company 소개</div>
            <hr />
            <Row>
                <Col xs = {24}  sm = {24}  md = {24}  lg = {8}>
                    <img alt="fortest" src={require('../public/Mainlogo1.png')} style={{width:"100%", height:"400px"}}/>
                </Col>
            </Row>
        </div>
    )
  }

  export default IndexPage;
